INSERT INTO `jobs` VALUES (8, 240, 33, 6, 'Software Developer/Analyst', '4', 'material-moving-worker', 'Responsibilities\n-Explore and propose various system optimizations to improve software performance.\n-Implement said optimizations where necessary/applicable.\n-Investigate and resolve complex system software issues. Interface with many functional teams from Kernel to application domains as part of the investigations.\n-Investigate system and process crashes using developed tools.\n-Perform initial triage to identify the offending component responsible for final resolution, and/or root cause where required.\n-Characterize and measure performance impacts of key feature submissions.\n\nQualifications\n-Bachelor or Masters degree or equivalent experience in Electrical/Computer Engineering, Computer Science or related field\n-5+ years’ professional experience in an embedded SW\n-Have a keen interest in software technologies, with emphasis on embedded systems design and optimization\n-High level of knowledge in C++ programming\n-Familiarity with gdb\n-Strong analytical and problem solving skills\n-Passion for improving system software performance\n-Strong communication and interpersonal skills\n\nAdditional Assets\n-Previous experience with QNX and/or Linux OS development\n-Development experience with infotainment and/or networking systems (CAN/Ethernet)\n-Experience with code repository and versioning tools such as Git', 65, 1, 3, 9, 'male', '15142', '2019-09-07', 0, '2019-04-02 02:24:46', '2019-04-02 02:24:46');
