INSERT INTO `jobs` VALUES (41, 306, 66, 3, 'Senior Mechanical Engineer ', '4', 'plant-and-system-operator', 'Key Duties:\n	•	Design all types of mechanical systems and equipment selection for use in various types of food or beverage plants (including HVAC, underground plumbing and other plumbing systems, natural gas facility distribution, etc.)\n	•	Improve operations, reduce turnaround times, and optimize processes to provide seamless quality of engineering services\n	•	Verify and validate engineering designs by testing protocols and analyzing statistical data\n	•	Ensure ongoing compliance with local, national, and international standards and legislation\nMust Haves:\n	•	University Degree in Mechanical Engineering\n	•	5 – 10 years of related experience working within the Food and Beverage Industry\n	•	Working knowledge of Ontario Building Code (HVAC and Plumbing), Ontario Fire Code, CFIA, ASHRAE STD as applied to HVAC and Refrigeration, NFPA, OSHA, TSSA, CSA Standard for fuel related appliances and equipment\n', 89, 1, 1, 4, 'male', '18164', '2019-08-26', 0, '2019-06-29 18:23:53', '2019-06-29 18:23:53');
INSERT INTO `jobs` VALUES (42, 308, 67, 1, 'Junior/Intermediate Electrical Technologist', '4', 'stonemason', 'You must have:\n	•	An Electrical Engineering Diploma from a recognized college or technical institution\n	•	Great interpersonal skills with the ability to develop business relationships\n	•	Strong attention to detail, problem-solving and analytical skills\n	•	Ability to prioritize and manage competing priorities with schedule and budget constraints\n	•	Strong collaborative skills and willingness to liaise with other disciplines (drafting, construction, survey, and civil) to ensure projects are accurate, compliant, on-time and on-budget\n', 89, 1, 2, 4, 'male', '13419', '2019-09-01', 0, '2019-05-19 08:00:56', '2019-05-19 08:00:56');
INSERT INTO `jobs` VALUES (43, 310, 68, 4, 'Electrical Systems Designer ', '2', 'textile-knitting-machine-operator', 'your responsibilities\n	•	Be part of a team responsible for the electrical design, conditioning and electrical systems support of the cockpit flight simulator;\n	•	Assist in the analysis of drawings, specifications and requirements from both internal/external customers;\n	•	Assist in defining the simulator hardware configuration, produce equipment lists, wiring diagram and electrical system schematics required to stimulate this equipment in a simulation environment;\n\n\nour requirements\n	•	Bachelors in Electrical Engineering or equivalent;\n	•	Strong knowledge of electrical engineering concepts;\n	•	Good working knowledge of CAO systems and word processing/spreadsheet softwares;\n	•	Good technical writing and communication skills;\n	•	Experience with electrical, avionic and power systems;\n\n\n', 89, 1, 9, 4, 'female', '19400', '2019-08-22', 0, '2019-05-07 03:19:33', '2019-05-07 03:19:33');
INSERT INTO `jobs` VALUES (44, 312, 69, 5, 'Bridge Engineer ', '2', 'communication-equipment-repairer', 'Qualifications\n\nWhat You Should Have:\n	•	Bachelors degree in Civil Engineering;\n	•	At least 7+ years experience in design of structural steel, pre-stressed and reinforced concrete bridges and bridge rehabilitation;\n	•	Experience with MTO projects is preferred;\n	•	PEO Licensed P.Eng preferred;\n	•	Conversant with CHBDC (CAN S-6) and the MTO Structural Manual;\n	•	Effective communication skills in the English language (verbal and written);\n', 89, 1, 7, 9, 'female', '12004', '2019-09-07', 0, '2019-02-26 15:15:28', '2019-02-26 15:15:28');
INSERT INTO `jobs` VALUES (45, 314, 70, 4, 'Package Delivery Driver', '4', 'transportation-attendant', 'Qualifications and Skills\n	•	Good knowledge of the city\n	•	Strong organizational skills\n	•	Previous customerservice experience\n\nRequirements:\n	•	Ability tolift up to 70lbs. unassisted\n	•	Full class 5 license\n	•	Clean DriversAbstract - No violations in the last 12 months, no accidents/suspensions inlast 3 years, no more than 2 violations or 5 demerits in the last 3 years\n	•	Previousexperience driving various sized vehicles from 1-ton up to 5-ton\n', 89, 1, 8, 10, 'male', '7661', '2019-09-21', 0, '2019-07-27 09:37:46', '2019-07-27 09:37:46');
INSERT INTO `jobs` VALUES (46, 316, 71, 4, 'Sr. Customer Assistant Representative', '2', 'buyer', 'Requirements:\nMust be at least 18 years old\nHigh school diploma or GED equivalent required\nSome college preferred\nMust have at least 1 year prior customer service, retail, or administrative support experience\nMust be authorized to work in Canada and not require work authorization sponsorship by our company for this position now or in the future.\nNo drug or alcohol related convictions on driving record (DWI/DUI) in past 5 years\nMust have a valid driver\'s license with no more than two chargeable moving violations or accidents within the last three years.', 89, 1, 2, 3, 'female', '19240', '2019-09-23', 0, '2019-03-03 09:13:03', '2019-03-03 09:13:03');
INSERT INTO `jobs` VALUES (47, 318, 72, 1, 'Guest Services Representative (Part-Time)', '1', 'tour-guide', 'Key requirements\n	•	High school education;\n	•	Previous customer service experience preferred;\n	•	Positive attitude and a strong desire to provide excellent customer service;\n	•	Must be able to effectively communicate with shoppers, retailers, centre Management, Service Providers and all of the shopping centre personnel;\n	•	Must be able to work in a fast-paced environment, with the ability to multi-task while maintaining a high level of professionalism;\n	•	Strong written and oral communication skills, multilingual skills a plus;\n	•	Conflict resolution/management skills;\n', 89, 1, 4, 9, 'female', '11591', '2019-09-28', 0, '2019-04-06 22:54:00', '2019-04-06 22:54:00');
INSERT INTO `jobs` VALUES (48, 320, 73, 5, 'Early Childhood Educator ', '4', 'food-tobacco-roasting', 'Requirements:\nDegree or diploma in Early Childhood Education \nRegistered and in good standing with the College of Early Childhood Educators\nStandard First Aid, including infant and child CPR\nPolice record check (vulnerable sector) completed in the last 6 months \nProof of Immunization (completed at least two [2] weeks before the start of employment), unless seeking exemption', 89, 1, 4, 3, 'male', '11794', '2019-09-02', 0, '2019-06-29 18:31:51', '2019-06-29 18:31:51');
INSERT INTO `jobs` VALUES (49, 322, 74, 2, 'Database Administrator', '1', 'photoengraver', 'Requirements:\n	•	Minimum Post-Secondary Degree or Diploma in Computer Science or equivalent\n	•	Must Have 3 to 6 years of experience in providing Oracle Database Administration: installation/configuration, security, backup/recovery, capacity planning, performance tuning, troubleshooting\n	•	Must Have 3+ years of experience with Microsoft SQL Server Database Administration, T-SQL, Replication, Always on availability Group DRS solution, Performance tuning\n	•	Must Have 1+ years of experience in working Oracle HA solution like RAC and DRS\n', 89, 1, 4, 4, 'male', '11520', '2019-08-30', 0, '2019-05-28 06:34:30', '2019-05-28 06:34:30');
INSERT INTO `jobs` VALUES (50, 324, 75, 1, 'DevOps Engineer', '4', 'pressing-machine-operator', 'YOU\'RE GOOD AT (2 or more years of experience):\n	•	T-SQL scripting within Microsoft SQL Server (or similar).\nYOU MAY BE GOOD AT, OR WANT TO LEARN:\n	•	Azure DevOps (or similar) build automation.\n	•	Regression testing planning and implementation.\n	•	Developing and managing Microsoft Azure assets.\n	•	Windows Server, IIS web hosting, and PowerShell.\n', 89, 1, 8, 8, 'female', '16085', '2019-08-24', 0, '2019-05-29 13:05:08', '2019-05-29 13:05:08');
INSERT INTO `jobs` VALUES (51, 326, 76, 1, 'Network Systems Analyst', '4', 'network-systems-analyst', 'Must-Have:\n\n	•	Bachelor degree or diploma in Computer Science or a related field\n	•	A minimum of 2 years hands on experience working with Juniper network devices including SRX firewalls, EX series switches, Juniper WIFI and SSL VPN equipment\n	•	Minimum of 5 years working in a network analyst/engineer role\n	•	Intermediate level experience with JUNOS operating system\n', 89, 1, 1, 7, 'male', '8002', '2019-09-04', 0, '2019-01-12 01:54:20', '2019-01-12 01:54:20');
